     3.8. Претензия Покупателя по скрытым недостаткам (производственный брак) подлежит рассмотрению Поставщиком только при наличии следующих документов: 
- письменная претензия; 
- Акт ТОРГ-2;
- фотографии бракованного товара, этикеток к нему с указанием артикула, номера партии;
- копия чеков от конечного потребителя на покупку товара и/или письменной претензии.
Поставщик вправе запросить дополнительные документы, фото/видео материалы или образцы некачественного товара.
